<script type="text/javascript">
	var elem = document.querySelectorAll(`[field*=icon-]`);
	var itms = dvn.map(elem,function(i,v){
		var rt = dvn(i).attr('field').replace('icon-','');
		return {element:i,param:rt};
	});
	dvn('#search')[0].onkeyup=function(e){
		if( this.value.length > 0 ){
			var buscando = this.value;
			dvn.each(itms,function(i,v){
				if(v.param.startsWith(buscando)){
					dvn(v.element).removeClass('d-hidden');
				}else{
					dvn(v.element).addClass('d-hidden');
				}
			});
		}else if( this.value.trim().length == 0 ){
			for(var i = 0 ; i < 5000 ; i ++ ){
					dvn(itms[i].element).removeClass('d-hidden');
			}
		}
	}
</script>
